import React from 'react';
import logo from './logo.svg';
import styles from './App.css';


class BtnSmall extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      theme: 'light',
      clicked: 0
    };
  }
  render() {
    return (
      <button id={this.props.name} className={"button-small theme-"+this.state.theme}>
      </button>
    );
  }
}

class BtnBox extends React.Component {
  constructor(props) {

  }
  render() {
    return(
      <div>
        <BtnSmall name="btnRewind" />
        <BtnSmall name="btnSkip" />
        <BtnSmall name="btnExit" />
      </div>
    );
  }
}

function App() {
  const element = <BtnBox />;
  return(element);
}
export default App;
